  true,\n\t\"url\": null,\n\t\"notes\": \"This data submission includes simulation
  results for ground loop heat pump systems located in 6 different cities across the
  United States. The cities are Boston, MA, Dayton, OH, Omaha, NE, Orlando, FL, Sacramento,
  CA, and St. Paul, MN. These results were obtained from the two-dimensional geothermal
  computer code called GEO2D. GEO2D was written as part of this DOE funded grant.
  The results included in this submission for each of the 6 cities listed above are:
  1) specific information on the building being heated or cooled by the ground loop
  geothermal system, 2) some extreme values for the building heating and cooling loads
  during the year, 3) the inputs required to carry out the simulation, 4) a plot of
  the hourly building heating and cooling loads throughout the year, 5) a plot of
  the fluid temperature exiting the ground loop for a 20 year period, 6) a plot of
  the heat exchange between the ground loop and the ground for a 20 year period, and
  7) ground and ground loop temperature contour plots at different times of the year
  for the 20 year period.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
